import { useEffect, useState } from "react";
import "../App.css";
import logoImg from "../img/logo.jpg";
import axios from "axios";
import url from '../host'

function Home() {
  const [text, setText] = useState("");
  const [data, setData] = useState([]);
  useEffect(() => {
    axios.get(`${url}/api/orders`).then(res => {
      setData(res.data)
      console.log(res.data);
    }).catch(err => {
      console.log(err);
    })
  }, [])
  function handlePress() {
    localStorage.clear();
    window.location = "/";
    window.reload();
  }
  function handlePress2() {
    console.log("key");
    document.querySelector(".Main").style = "display: block";
    
    setText(document.querySelector(".inpp").value);
    axios.get(`${url}/api/orders/search?trek_id=aasdfu231234`)
  }
  return (
    <div className="App">
      <div className="navbar">
        <div className="minNav">
          <img src={logoImg} alt="" />
          {localStorage.getItem("key") ? (
            localStorage.getItem("key") == 1 ? (
              <div
                className="bgasc"
                style={{
                  width: "27%",
                  display: "flex",
                  justifyContent: "space-between",
                }}
              >
                <a href="/profile">
                  <button>Профиль</button>
                </a>
                <a href="/admin">
                  <button>Админ панел</button>
                </a>

                <button onClick={() => handlePress()}>Выйти</button>
              </div>
            ) : localStorage.getItem("key") == 2 ? (
              <div
                style={{
                  width: "15%",
                  display: "flex",
                  justifyContent: "space-between",
                }}
              >
                <a href="/profile">
                  <button>Профиль</button>
                </a>
                <button onClick={() => handlePress()}>Выйти</button>
              </div>
            ) : localStorage.getItem("key") == 3 ? (
              <div
                className="bgasc"
                style={{
                  width: "27%",
                  display: "flex",
                  justifyContent: "space-between",
                }}
              >
                <a href="/profile">
                  <button>Профиль</button>
                </a>
                <a href="/manager">
                  <button>Админ панел</button>
                </a>

                <button onClick={() => handlePress()}>Выйти</button>
              </div>
            ) : (
              <a href="/login">
                <button>Войти</button>
              </a>
            )
          ) : (
            <a href="/login">
              <button>Войти</button>
            </a>
          )}
          {/* {localStorage.getItem("key") ? (
            <a href="/profile">
              <button>Профиль</button>
              <button
                style={{ marginLeft: "10px" }}
                onClick={() => handlePress()}
              >
                Выйти
              </button>
            </a>
          ) : (
            <a href="/login">
              <button>Войти</button>
            </a>
          )} */}
        </div>
      </div>
      <div className="header">
        <div className="shadowDiv" />
        <div className="inputForm">
          <input
            type="text"
            placeholder="Введите трек-код (номер отслеживания)"
            className="inpp"
          />
          <button onClick={() => handlePress2()}>Найти</button>
        </div>
      </div>
      <div
        className="Main"
        style={{
          backgroundColor: "#0d6dfd0a",
          display: "none",
        }}
      >
        <center>
          <h1>Статус заказ: {text}</h1>
        </center>
        <div
          style={{
            display: "flex",
            justifyContent: "space-between",
            width: "60%",
            margin: "auto",
          }}
        >
          <h1>Отправ</h1>
          <h1>Кому</h1>
        </div>
        <div
          style={{
            display: "flex",
            justifyContent: "space-between",
            width: "60%",
            margin: "auto",
          }}
        >
          <h1
            style={{
              display: "flex",
              alignItems: "center",
              // justifyContent: "space-between",
            }}
          >
            Отправитель:{" "}
            <p style={{ fontSize: 20, fontWeight: "lighter", marginLeft: 10 }}>
              Ivanov
            </p>
          </h1>
          <h1
            style={{
              display: "flex",
              alignItems: "center",
              // justifyContent: "space-between",
            }}
          >
            Получатель:{" "}
            <p style={{ fontSize: 20, fontWeight: "lighter", marginLeft: 10 }}>
              petrov
            </p>
          </h1>
        </div>
        <div
          style={{
            display: "flex",
            justifyContent: "space-between",
            width: "60%",
            margin: "auto",
          }}
        >
          <h1>Откуда</h1>
          <h1>Куда</h1>
        </div>
        <div
          style={{
            display: "flex",
            justifyContent: "space-between",
            width: "60%",
            margin: "auto",
            marginTop: -20,
          }}
        >
          <p>Откуда</p>
          <p>Куда</p>
        </div>
        <div
          style={{
            background: "#fff",
            width: "65%",
            margin: "auto",
            padding: 10,
          }}
        >
          <a href="">Скрить польны маршут</a>
